INSERT INTO `eb_store_product` VALUES (36, 79, 2, 'http://www.fyang.com/public/uploads/attach/2019/10/24/5db187669dd97.jpg', '[\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18764be441.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187636e202.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18763397a7.jpg\"]', '厦门鼓浪屿', '鼓浪屿（英文：Kulangsu） 原名“圆沙洲”，别名“圆洲仔”，南宋时期命“五龙屿”，明朝改称“鼓浪屿”。因岛西南方海滩上有一块两米多高、中有洞穴的礁石，每当涨潮水涌', '鼓浪屿（英文：Kulangsu） 原名“圆沙洲”，别名“圆洲仔”，南宋时期命“五龙屿”，明朝改称“鼓浪屿”。因岛西南方海滩上有一块两米多高、中有洞穴的礁石，每当涨潮水涌', '', 499.00, 0.00, 899.00, 0.00, '件', 0, 55555, 5652, 1, 0, 0, 0, 0, '', 1571651710, 0, 0, 0, 520.00, 399.00, 0, NULL, 559, 0, '0', '', '河北省/秦皇岛市', '1、大巴往返费用自费。2、路途消费购物自费。', 21, NULL, NULL);
INSERT INTO `eb_store_product` VALUES (37, 80, 2, 'http://www.fyang.com/public/uploads/attach/2019/10/24/5db18763397a7.jpg', '[\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187647dd3a.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187630cfe6.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18762d2411.jpg\"]', '平潭乐园', '平潭县（古属福州府福清县）简称“岚”，俗称海坛。平潭县与平潭综合实验区实行“政区合一”（行政区和实验区）的管理体制。位于福建省东部，与台湾隔台湾海峡相望', '平潭县（古属福州府福清县）简称“岚”，俗称海坛。平潭县与平潭综合实验区实行“政区合一”（行政区和实验区）的管理体制。位于福建省东部，与台湾隔台湾海峡相望', '', 899.00, 0.00, 1099.00, 0.00, '件', 0, 4547, 44543, 1, 1, 0, 1, 0, '', 1571652349, 0, 0, 0, 520.00, 699.00, 0, NULL, 444, 0, '0', '', '河北省/秦皇岛市', '1、大巴往返费用自费。2、路途消费购物自费。', 20, NULL, NULL);
INSERT INTO `eb_store_product` VALUES (38, 80, 2, 'http://www.fyang.com/public/uploads/attach/2019/10/24/5db18762d2411.jpg', '[\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18763a91c7.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18763397a7.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187630cfe6.jpg\"]', '福州榕城', '福州，别称榕城，简称福、榕，隶属于福建省，位于福建省东部、闽江下游及沿海地区，是福建省省会，福建省的政治、文化、交通中心，海峡西岸经济区中心城市之一。福州建城于公元前202年，历史上曾长期作为福建的政治中心。', '福州，别称榕城，简称福、榕，隶属于福建省，位于福建省东部、闽江下游及沿海地区，是福建省省会，福建省的政治、文化、交通中心，海峡西岸经济区中心城市之一。福州建城于公元前202年，历史上曾长期作为福建的政治中心。', '', 388.00, 0.00, 488.00, 0.00, '件', 0, 6666, 14442, 1, 1, 1, 1, 1, 'www.baidu.com<p></p>', 1571652557, 0, 0, 0, 114.00, 299.00, 0, NULL, 1114, 0, '0', '', '河北省/秦皇岛市', '1、大巴往返费用自费。2、路途消费购物自费。', 19, NULL, NULL);
INSERT INTO `eb_store_product` VALUES (39, 80, 2, 'http://www.fyang.com/public/uploads/attach/2019/10/24/5db18765833ad.jpg', '[\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187647dd3a.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db187644fcf5.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18762d2411.jpg\"]', '蓉城锦城', '成都，四川省辖地级市，简称蓉，别称“蓉城、锦城”，是四川省省会、副省级市，特大城市，西部战区机关驻地，国务院确定的国家重要高新技术产业基地、商贸物流中心和综合交通枢纽，西部地区重要的中心城市。', '成都，四川省辖地级市，简称蓉，别称“蓉城、锦城”，是四川省省会、副省级市，特大城市，西部战区机关驻地，国务院确定的国家重要高新技术产业基地、商贸物流中心和综合交通枢纽，西部地区重要的中心城市。2', '', 1699.00, 0.00, 1899.00, 44.00, '件', 0, 0, 4457, 1, 1, 1, 1, 0, '', 1571652713, 0, 0, 0, 4000.00, 1099.00, 0, NULL, 1141, 0, '0', '', '河北省/秦皇岛市', '1、大巴往返费用自费。2、路途消费购物自费。', 18, NULL, NULL);
INSERT INTO `eb_store_product` VALUES (42, 80, 2, 'http://www.fyang.com/public/uploads/attach/2019/10/24/5db18765bcd38.jpg', '[\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18765bcd38.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18765833ad.jpg\",\"http:\\/\\/www.fyang.com\\/public\\/uploads\\/attach\\/2019\\/10\\/24\\/5db18764e7a27.jpg\"]', '三坊七巷', '\"三坊七巷\"地处福州市中心，是南后街两旁从北到南依次排列的十条坊巷的概称。\"三坊\"是：衣锦坊、文儒坊、光禄坊。\"七巷\"是：杨桥巷、郎官巷、安民巷、黄巷、塔巷、宫巷、吉庇巷。福州云顶：福州唯一的山岸观光', '\"三坊七巷\"地处福州市中心，是南后街两旁从北到南依次排列的十条坊巷的概称。\"三坊\"是：衣锦坊、文儒坊、光禄坊。\"七巷\"是：杨桥巷、郎官巷、安民巷、黄巷、塔巷、宫巷、吉庇巷。福州云顶：福州唯一的山岸观光', '', 899.00, 0.00, 1099.00, 0.00, '件', 0, 4111, 11240, 1, 0, 0, 0, 0, '<h1 style=\"margin: 0px 10px 0px 0px; padding: 0px; font-size: 34px; color: rgb(51, 51, 51); display: inline; line-height: 1.15; font-weight: 400; vertical-align: sub; font-family: arial, tahoma, &quot;Microsoft Yahei&quot;, 宋体, sans-serif; white-space: normal;\">三坊七巷</h1><span style=\"color: rgb(51, 51, 51); font-family: arial, tahoma, &quot;Microsoft Yahei&quot;, 宋体, sans-serif; font-size: 20px;\">（福州明清时期古建筑）</span><div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;\">三坊七巷是<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">国家5A级旅游景区</a>，是<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">福州</a>老城区经历了建国后的拆迁建设后仅存下来的一部分。是福州的历史之源、文化之根。</div><div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;\">三坊七巷自<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">晋</a>、<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">唐</a>形成起，便是贵族和<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">士大夫</a>的聚居地，清至民国走向辉煌。区域内现存古民居约有270座，有159处被列入保护建筑。以<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">沈葆桢</a>故居、<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">林觉民</a>故居、<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">严复</a>故居等9处典型建筑为代表的三坊七巷古建筑群，被<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">国务院</a>公布为<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">全国重点文物保护单位</a>。<span class=\"sup--normal\" style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\">&nbsp;[1]</span><a class=\"sup-anchor\" style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\" href=\"http://undefined\">&nbsp;</a></div><div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;\">位于<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">福州</a>中心城区（老城区）的三坊七巷拥有38公顷的完整保护范围。三坊七巷为国内现存规模较大、保护较为完整的<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">历史文化街区</a>，是全国为数不多的古建筑遗存之一，有“中国城市里坊制度活化石”和“<a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">中国</a><a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">明清</a><a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">建筑</a><a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">博物馆</a>”的美称。2009年6月10日，三坊七巷历史文化街区获得文化部、国家文物局批准的“中国十大历史文化名街”荣誉称号。<span class=\"sup--normal\" style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\">&nbsp;[1]</span></div><p><img src=\"http://www.fyang.com/public/uploads/editor/20191028/5db692f8343bd.jpg\" style=\"width: 390px; height: 256px;\"/></p><p><br/></p>', 1571917287, 0, 0, 0, 111.00, 777.00, 0, NULL, 144, 0, '0', '', '河北省/秦皇岛市', '<p class=\"_j_note_content _j_seqitem\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; overflow-wrap: break-word; line-height: 28px; font-size: 15px; color: rgb(68, 68, 68); text-align: justify; word-break: break-word; font-family: Arial, &quot;Lucida Grande&quot;, &quot;Microsoft Yahei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Hiragino Sans GB W3&quot;, SimSun, &quot;PingFang SC&quot;, STHeiti; white-space: normal;\">9月30号晚上22:00到的&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;，因为比较晚了，感觉&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;没有那么繁华。第二天去了三坊七巷，那里的好多小巷子好有文化的底蕴，三坊七巷周边的街道有好多卖衣服的小店，那里的服务态度超级好，随你怎么试衣服，她们也不会感到厌烦，反而很高兴，作为&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">东北</a>&nbsp;人很佩服他们的服务意识。也只有这样，生意才会做的长久，让我对&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;好多的小街道有种流连忘返的感觉。去了&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;一家百年老字号的饭店，安泰楼酒家，味道还不错。去&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;的朋友可以去品尝一下，每一样的美食都是很小的一份，人多可以多点些小吃。</p><div id=\"_j_photo_274507468\" class=\"add_pic _j_anchorcnt _j_seqitem\" style=\"margin: 0px 0px 18px; padding: 0px; overflow-wrap: break-word; position: relative; color: rgb(68, 68, 68); font-family: Arial, &quot;Lucida Grande&quot;, &quot;Microsoft Yahei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Hiragino Sans GB W3&quot;, SimSun, &quot;PingFang SC&quot;, STHeiti; font-size: 15px; white-space: normal; width: 680px;\"><a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(255, 138, 0); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; display: block; position: relative; zoom: 1;\"><img class=\"\" src=\"http://b2-q.mafengwo.net/s10/M00/AF/79/wKgBZ1o2XQiANtvYAArnhtYrXLo55.jpeg?imageMogr2%2Fthumbnail%2F1360x%2Fstrip%2Fquality%2F90\" alt=\"\" style=\"border: 0px; vertical-align: middle; height: 1181px; width: 680px; background: rgb(252, 242, 220); display: block;\"/></a></div><p><br/></p>', 17, NULL, '<p class=\"_j_note_content _j_seqitem\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; overflow-wrap: break-word; line-height: 28px; font-size: 15px; color: rgb(68, 68, 68); text-align: justify; word-break: break-word; font-family: Arial, &quot;Lucida Grande&quot;, &quot;Microsoft Yahei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Hiragino Sans GB W3&quot;, SimSun, &quot;PingFang SC&quot;, STHeiti; white-space: normal;\">三坊七巷，由三个坊、七条巷和一条中轴街肆组成。<br/>可别小瞧了这片街巷，坊巷内保存有200余座古建筑，马鞍墙、雕饰、建筑门都是这的建筑特色。这里又名人辈出，林则徐、沈葆桢、曾宗彦、严复、林旭、林长民、林觉民、冰心、陈矩孙、王冷斋、郑孝胥、陈宝琛、邓拓、甘国宝、左宗棠、郁达夫等，可以说是～闽都名人的聚居地。<br/>三坊七巷街区，和许多街巷一样，都有很多地方或区域小吃。最令我常思的，当数&nbsp;<a href=\"http://undefined\" class=\"link _j_keyword_mdd\" target=\"_blank\" style=\"color: rgb(77, 77, 77); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; border-bottom: 1px solid rgb(148, 142, 142);\">福州</a>&nbsp;鱼丸和街边早点铺的馄饨。<br/>特意去到林则徐纪念馆，凭吊这位英雄。馆不大，展陈做的挺不错。<br/></p><div id=\"_j_photo_279227283\" class=\"add_pic _j_anchorcnt _j_seqitem\" style=\"margin: 0px 0px 18px; padding: 0px; overflow-wrap: break-word; position: relative; color: rgb(68, 68, 68); font-family: Arial, &quot;Lucida Grande&quot;, &quot;Microsoft Yahei&quot;, &quot;Hiragino Sans GB&quot;, &quot;Hiragino Sans GB W3&quot;, SimSun, &quot;PingFang SC&quot;, STHeiti; font-size: 15px; white-space: normal; width: 680px;\"><a target=\"_blank\" href=\"http://undefined\" style=\"color: rgb(255, 157, 0); text-decoration-line: none; cursor: pointer; background-color: transparent; outline: 0px; display: block; position: relative;\"><img class=\"\" src=\"http://b2-q.mafengwo.net/s11/M00/3B/EA/wKgBEFpNsB2AC4YRAA7wB1KMoyg34.jpeg?imageMogr2%2Fthumbnail%2F1360x%2Fstrip%2Fquality%2F90\" alt=\"\" style=\"border: 0px; vertical-align: middle; height: 1018px; width: 680px; background: rgb(252, 242, 220); display: block;\"/></a></div><div id=\"_j_photo_279227289\" class=\"add_pic _j_anchorcnt _j_seqitem\" style=\"margin: 